import React, { Component } from 'react';

class Current extends Component {
    render() {
        return (
            <div>
                <div className='title'>Current</div>
                <table>
                    <tr>
                        <th>Time</th>
                        <th>Price</th>
                    </tr>
                    <tr>
                        <td>{this.props.display.time}</td>
                        <td>{this.props.display.price}</td>
                    </tr>
                </table>
            </div>
        );
    }
}

export default Current;
